import React from 'react';

const BackgroundImage = () => {
	return (
		<div style={{
			backgroundImage: "url('/static/block.png')",
			backgroundSize: 'cover',
			backgroundPosition: 'center',
			backgroundRepeat: 'no-repeat',
			margin: 0,
			padding: 0,
			width: '100vw',
			height: '100vh'
		}}>

		</div>
	);
};

export default BackgroundImage;
